import React from 'react';
import MagicGrid from "react-magic-grid"

import '../../css/MG.css';

function MagicGridPage() {
    const Cards = ({ cards }) => (
        <MagicGrid items={cards.length}>
            {cards.map(item => (
            <Card key={item} item={item} />
            ))}
        </MagicGrid>
    )

      const Card = ({ name }) => {
        return <div className="Card">{name}</div>;
    };

    return (
        <div>
            <div className="container">
                <Cards>
                    <img src="https://picsum.photos/200/300" />
                </Cards>
                <div>
                    <img src="https://picsum.photos/200/340" />
                </div>
                <div>
                    <img src="https://picsum.photos/200/280" />
                </div>
                <div>
                    <img src="https://picsum.photos/200/390" />
                </div>
                <div>
                    <img src="https://picsum.photos/200/200" />
                </div>
                <div>
                    <img src="https://picsum.photos/200/500" />
                </div>
                <div>
                    <img src="https://picsum.photos/200/100" />
                </div>
                <div>
                    <img src="https://picsum.photos/200/250" />
                </div>
                <div>
                    <img src="https://picsum.photos/200/320" />
                </div>
                <div>
                    <img src="https://picsum.photos/200/300" />
                </div>
            </div>

            <script src="{% static 'js/magicgrid.js' %}"></script>
        </div>
    );
}

export default MagicGridPage;
